import React from "react";

const ContactForm = () =>{
    return(
        <div className="contact-form border">
        <form action="" >
                     <label className="form_heading">Send A Message </label><br/>
                     <input type="text" placeholder="Your Name" className="form_name"/>
                     <input type="email" placeholder="Email Address" className="form_email" /><br/>
                     <input type="text" placeholder="Subject" className="form_subject"/><br/>
                     <textarea type="text" placeholder="Message"/><br/>
                     <button type="submit">Submit</button>


                    </form>

        </div>

    )
}

export default ContactForm;
